import './personalDetails.css';
import 'font-awesome/css/font-awesome.min.css';

const PersonalDetails = () => {
    const details = require("../details/personal-details.json");
    return (
        <div className="sideDetails">   
            <i className="fa fa-user" style={{marginLeft: 100}}>           {details.Name}        </i>
            <i className="fa fa-phone" style={{marginLeft: 100}}>          {details.Phone}       </i>
            <i className="fa fa-birthday-cake" style={{marginLeft: 100}}>  {details.DateOfBirth} </i>
            <i className="fa fa-envelope-open" style={{marginLeft: 100}}>  {details.Email}       </i>
            <i className="fa fa-github" style={{marginLeft: 100}}>         {details.Github}      </i>
        </div>)
}
export default PersonalDetails;
